import * as style from "../../css/light/profileListContainer"

export default function ProfileListItem({data}) {
  const renderListDataMain = () => {
    return (
      <a
          href={item[Object.keys(item).at(-1)]['data']}
          target="_blank"
          rel="noreferrer"
          style={style.profileListContainerMain}>
        {data[0]['data']}
      </a>
    )
  }

  const renderListDataOther = () => { //Change this to a React Component
    const renderDataList = () => {
      return data.slice(1, Object.keys(data).at(-1)).map((item, i) => (
        <div key={`LData${i}`} style={style.profileListContainerOther}>{item['data']}</div>
      ))
    }

    return (
      <div style={{display: "flex", width: "100%", marginLeft: "10px"}}>
        {renderDataList()}
      </div>
    )
  }

  return (
    <div>
      <div 
      onMouseEnter={(e) => {
        e.currentTarget.style.border = "1px solid black"  
      }}
      onMouseLeave={(e) => {
        e.currentTarget.style.border = "1px solid #4382BC"
      }}
      onClick={(e) => {
        console.log(e.nativeEvent.path[0])
      }}
      style={style.profileListContainer}>
        {renderListDataMain()}
        {renderListDataOther()}
      </div>
      <div style={{height: "3px", cursor: "default"}}></div>
    </div>
  )
}
